import React from "react";
import "./board.css";
import {MoreHorizontal,Plus} from "react-feather";

function Board() {
    return (
        <div className="board">
            <div className="board_top">
                <p className="board_top_title">To do <span>2</span></p>
                <MoreHorizontal />
                <Plus />
            </div>
            <div className="board_cards">
                <h1>Card 1</h1>
                <h1>Card 2</h1>
            </div>
        </div>
    )
}

export default Board;
